window.bookSummaryJSON = "<p>Books eight through 10 in the <i>USA Today</i> best-selling Dead Cold series from two-million best-selling author Blake Banner.</p> <p><b>Books included:</b></p> <ul> <li><i>Unnatural Murder</i> (book eight)</li> <li><i>Fire from Heaven</i> (book nine)</li> <li><i>To Kill upon a Kiss</i> (book 10)</li> </ul> <p>Sebastian Acosta has been gunned down at three a.m. on a Saturday morning, sitting behind the wheel of a beaten-up Toyota. The passenger door is open, and a few paces away his pal Luis Irizarry lies with his life ebbing away through two gunshot wound in his chest. It should be a red hot case, except that 15 years earlier, Rosario Rojas was raped and strangled in that selfsame house, the house Luis was crawling toward, the house that belonged to Angela Rojas, Rosario’s daughter.</p> <p>Rosario, who was like a sister to Marta Flores, Detective Dehan’s mother.</p> <p>Things get more complicated when it emerges that Rosario had started to get involved in a set whose morals Marta had considered a little too lax, a bit too broad-minded; when it emerges that the two boys who just got shot are the sons of two of the couples who made up that set.</p> <p>But then it turns out, this is just the tip of the iceberg in this old, cold case....</p>"; 
